import React from "react"


export default function Table(props) {
    let style = { border: "1px solid black" }
    return (
        <div style={{ marginLeft: '25%' }}>
            <table>
                <thead>
                    <tr>
                        {props.headings.map((item) => {
                            return <td style={style}>
                                <h3>{item}</h3>
                            </td>
                        })}
                    </tr>
                </thead>
                <tbody>
                    {props.newArr.map((item, i) => {
                        return props.view == "users" ? <tr key={i}>
                            <td style={style}>{item.username}</td>
                            <td style={style}>{item.name}</td>
                            <td style={style}>{item.email}</td>
                            <td style={style}>{item.website}</td>
                            </tr> : <tr key={i}>
                                <td style={style}>{item.title}</td>
                                <td style={style}><a href="#" onClick={(e) => props.onChangeView(e, i)}>{item.username}</a></td>
                            </tr>
                    })}
                </tbody>
            </table>
        </div>
    )
}
